msg.data:
{
  "ID": "PM10",
  "Name": "Schwebestaub PM10",
  "Einheit": "µg/m3",
  "Beschreibung": "Lungengängiger Feinstaub ist eine Mischung von kleinsten Teilchen mit weniger als einem Hundertstel Millimeter Durchmesser (10 µm). Sie unterscheiden sich in Grösse, Herkunft und Wirkung. Dazu zählen, nebst natürlichen mineralischen Anteilen, Abriebteilchen von Pneus und Strassenbelag, Aufwirbelungen, Russteilchen aus Holzfeuerungen auch Dieselruss sowie Partikel aus illegaler Abfallverbrennung. Eine wichtige Rolle spielt zudem die Partikelbildung aus gasförmigen Vorläuferschadstoffen, namentlich Stickoxiden, Schwefeldioxid und Ammoniak. Zudem haften an den Partikeln aus Verbrennungsprozessen Substanzen wie polyaromatische Kohlenwasserstoffe (PAK) und Dioxine, die teils krebserregend und erbgutschädigend wirken können."
}
Grenzwert:
{
  "Schadstoff": "PM10",
